import Maincontent from '../MainContent/maincontent.js';
import { useAuth0 } from "@auth0/auth0-react";
import './Home.css';

import './Home.css';
export default function Home() {
  const { isAuthenticated,user } = useAuth0();

  return (
    <>
    {isAuthenticated?

    <Maincontent/>:
    (<div className="userLogOut">Please LogIn first <br/> <div>{(user.role === "unauth")? "Please Login with KIET gmail ID" : ""};</div>
</div>)
  };
  </>
  );
}
